import { Search, SearchIcon } from "lucide-react";
import React from "react";

export default function SearchInput() {
  return (
    <form>
      <label for="simple-search" class="sr-only">
        Search
      </label>
      <div class="relative w-full">
        <div class="absolute inset-y-0 start-0 flex items-center ps-3 pointer-events-none">
          <SearchIcon className="w-4 h-4 text-gray-200 dark:text-gray-400" />
        </div>
        <input
          type="text"
          id="simple-search"
          class="bg-gray-50 border border-gray-700 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full ps-10 px-20 py-1.5  dark:bg-gray-200 dark:border-gray-100 dark:placeholder-gray-400 dark:text-gray-500 dark:focus:ring-blue-500 dark:focus:border-blue-500"
          placeholder="Buscar producto..."
          required
        />
      </div>
    </form>
  );
}
